import React, { Component } from 'react';
import {Link} from "react-router-dom";
import "../App.css"

export default class BreedList extends Component {
    constructor(){
        super()
        this.state = {
            breed : null
        }
    }
    componentDidMount(){
        fetch("https://dog.ceo/api/breeds/list/all").then(res=>res.json()).then(data=>this.setState({
            breed : data.message
        }));
    }

    render() {
        let ary = this.state.breed || {};
        // ary ? console.log("if true ",Object.keys(ary)) : console.log("nothing & false ", ary)
        return (
            <div class="container breedlist-container">
                 <div class="notification">
                <h1>List of all available Dog Breed we have.</h1>
                {Object.keys(ary).map(key=>{
                    return(
                        <>
                            <details>
                                <summary>
                                    <Link to={`/randompic/${key}`}>{key}</Link>
                                </summary>
                                {ary[key].map(d=>(
                                    <li>{d}</li>
                                ))}
                            </details>
                        </>
                    )
                })}
                </div>
            </div>
        )
    }
}
